import React from "react";
import { useParams, useNavigate } from "react-router-dom";
import { Carousel } from "react-bootstrap";
import "bootstrap/dist/css/bootstrap.min.css";

const CarDetailPage = ({ cars }) => {
  const { id } = useParams();
  const navigate = useNavigate();
  const car = cars.find(c => c.id === parseInt(id));

  if (!car) return <div>Авто не найдено</div>;

  const { brand, model, price, images, details } = car;

  return (
    <div style={{ padding: "20px" }}>
      <button onClick={() => navigate(-1)} style={{ marginBottom: "20px" }}>← Назад</button>
      <h2>{brand} {model}</h2>
      <Carousel>
        {images.map((img, i) => (
          <Carousel.Item key={i}>
            <img
              className="d-block w-100"
              src={img.url}
              alt={img.caption || `Image ${i}`}
              style={{ maxHeight: "100px", objectFit: "cover" }}
            />
          </Carousel.Item>
        ))}
      </Carousel>
      <h4 style={{ marginTop: "20px" }}>{price} USD</h4>
      <ul>
        <li><b>Год выпуска:</b> {details.year}</li>
        <li><b>Пробег:</b> {details.mileage} км</li>
        <li><b>Кузов:</b> {details.body}</li>
        <li><b>Цвет:</b> {details.color}</li>
        <li><b>Двигатель:</b> {details.engine}</li>
        <li><b>Коробка:</b> {details.gearbox}</li>
        <li><b>Привод:</b> {details.drive}</li>
        <li><b>Руль:</b> {details.wheel}</li>
        <li><b>Состояние:</b> {details.condition}</li>
        <li><b>Таможня:</b> {details.customs}</li>
        <li><b>Обмен:</b> {details.exchange}</li>
        <li><b>Наличие:</b> {details.availability}</li>
        <li><b>Регион, город:</b> {details.location}</li>
      </ul>
    </div>
  );
};

export default CarDetailPage;
